:local(.top_bar_messages) {
    border-bottom: 1px solid #efefef;
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    z-index: 2;
    height: 50px;
    background: #fff;
    display: table;
    table-layout: fixed;
}

:local(.top_bar_messages div) {
    display: table-cell;
    text-align: center;
    vertical-align: middle;
    color: #ACACAC;
    font-size: 16px;
    font-weight: 300;
}

:local(.left_inbox) {
    padding-left: 0;
    padding-top: 50px;
    border: none;
    width: 34%;
    border-right: 1px solid #eee;

    display: inline-block;
    min-height: 100%;
    height: 100%;
    position: relative;
    vertical-align: middle;
    float: left;
}

:local(.conversations_container) {
    height: 100%;
    max-height: 100%;
    overflow-y: auto;
}

:local(.relative) {
    position: relative;
}
